import React from "react";
import Cart from "../Cart/Cart";
import style from "./Header.module.css";
import logo from "./meals.jpg";

const Header = () => {
  return (
    <>
      <div className={style.header}>
        <h1>ReactMeals</h1>
        <Cart />
      </div>
      <img className={style.mainImage} src={logo} />
    </>
  );
};

export default Header;
